import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './styles.css';
import SideBar from './components/SideBar';
import MainPanel from './components/MainPanel';
import IntroPanel from './components/IntroPanel';
import ConclusionPanel from './components/ConclusionPanel';
import PostsPanel from './components/posts/PostsPanel';
import ImageUpload from './components/image/ImageUpload';
import ApiDocs from './components/api/ApiDocs';
import AnalyticsPanel from './components/analytics/AnalyticsPanel';

function App() {
  return (
    <Router>
      <div className="container">
        <SideBar />
        <div className="content">
          <Routes>
            <Route path="/" element={<IntroPanel />} />
            <Route path="/intro" element={<IntroPanel />} />
            <Route path="/types" element={<MainPanel />} />
            <Route path="/posts" element={<PostsPanel />} />
            <Route path="/image-upload" element={<ImageUpload />} />
            <Route path="/api-docs" element={<ApiDocs />} />
            <Route path="/analytics" element={<AnalyticsPanel />} />
            <Route path="/conclusion" element={<ConclusionPanel />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
